import{_ as e,c as t,m as r,o}from"./chunks/framework.CcfPirFf.js";const s="/assets/all.Di6Ql42Y.png",l="/assets/student.c2LWfMza.jpg",i="/assets/zhangjing.BHqdBaVT.jpg",n="/assets/luyao.BYYgtSAq.jpg",h="/assets/gaotingquan.BcNi6Vl6.jpg",d="/assets/greatv.DZ6X6d8L.jpg",p="/assets/wanghaitao.lbU4j6qU.jpg",u="/assets/zhangziyu.DXhWMtHc.jpg",c="/assets/luotao.CXra0mw6.jpg",x=JSON.parse('{"title":"百度“与你一起定义飞桨的未来”主题活动走进浙江大学软件学院成功举办","description":"","frontmatter":{"title":"百度“与你一起定义飞桨的未来”主题活动走进浙江大学软件学院成功举办","date":"2024-11-26T00:00:00.000Z","author":{"name":"骆涛","github":"luotao1"},"category":"community-activity"},"headers":[],"relativePath":"posts/zju-event.md","filePath":"posts/zju-event.md"}'),_={name:"posts/zju-event.md"};function m(g,a,f,b,P,q){return o(),t("div",null,[...a[0]||(a[0]=[r('<p>为深入探讨、推动开源人才培养，助力开源生态繁荣向前，10 月 29 日下午，百度“与你一起定义飞桨的未来”主题活动，作为 <a href="https://mp.weixin.qq.com/s/i05v5HunUogrn0de7SqivA" target="_blank" rel="noreferrer">“源”来在“浙”里｜开源企业走进校园系列活动</a> 之一，在浙江大学软件学院成功举办。</p><hr><p>飞桨高级产品经理张晶，高级研发工程师郜廷权，研发工程师陆瑶、王海涛，AI 生态部邵一鸣，产品运营张子彧，美康生物算法工程师、PaddleOCR PMC Chair、飞桨开发者技术专家 PPDE 汪昕，为同学们带来 AI 前沿技术和百度飞桨开源产品及其应用介绍、开源对技术优化的意义、文心一言大模型案例解读等内容。专家们结合自身的经验经历进行分享，内容具备很强的实践性和启发性，助力同学们开启开源之旅。 <img src="'+s+'" alt="活动讲师合影"><img src="'+l+'" alt="学生认真听讲"></p><h2 id="主题报告" tabindex="-1">主题报告 <a class="header-anchor" href="#主题报告" aria-label="Permalink to &quot;主题报告&quot;">​</a></h2><h3 id="_1-shape-the-future-开源、飞桨与你我" tabindex="-1">1. Shape the future : 开源、飞桨与你我 <a class="header-anchor" href="#_1-shape-the-future-开源、飞桨与你我" aria-label="Permalink to &quot;1. Shape the future : 开源、飞桨与你我&quot;">​</a></h3><p>张晶（百度飞桨高级产品经理 <a href="https://github.com/openvino-book" target="_blank" rel="noreferrer">@openvino-book</a>）重点分享了全球著名开源项目 PaddlePaddle 的前世今后、当前取得的成绩、共建共享的开源精神；以及如何参与飞桨开源社区，如何在共建飞桨的过程中，提升技术、成长自己、共筑未来。 <img src="'+i+'" alt="百度飞桨高级产品经理张晶"></p><h3 id="_2-飞奖多模态大模型套件-paddlemix-分享及应用" tabindex="-1">2. 飞奖多模态大模型套件 PaddleMIX 分享及应用 <a class="header-anchor" href="#_2-飞奖多模态大模型套件-paddlemix-分享及应用" aria-label="Permalink to &quot;2. 飞奖多模态大模型套件 PaddleMIX 分享及应用&quot;">​</a></h3><p>陆瑶（百度飞桨研发工程师 <a href="https://github.com/luyao-cv" target="_blank" rel="noreferrer">@luyao-cv</a>）作了以《飞桨多模态大模型开发套件 PaddleMIX 》为主题的报告。本报告重点介绍了 PaddleMIX 开源建设活动、多模态大模型能力与场景应用、多模态大模型架构演进及特点以及多模态大模型开发套件 PaddleMIX 。报告详细阐述了多模态大模型的核心能力，包括图像理解、文本生成、跨模态互动等功能，并展示了其在各领域的实际应用场景。在架构方面，陆工程师深入分析了多模态大模型的演进历程，重点讨论了不同架构的特点和优势，为开发者选择合适的模型架构提供了参考。PaddleMIX 开发套件的功能特性得到重点展示，包括模型训练、推理部署、性能优化等关键模块。该套件不仅降低了开发门槛，还提供了丰富的预训练模型和示例，有效支持开发者快速构建多模态应用。这次报告展现了百度在多模态大模型领域的技术实力，为推动人工智能技术发展做出了积极贡献。 <img src="'+n+'" alt="百度飞桨研发工程师陆瑶"></p><h3 id="_3-低代码工具-paddlex-实践应用" tabindex="-1">3. 低代码工具 PaddleX 实践应用 <a class="header-anchor" href="#_3-低代码工具-paddlex-实践应用" aria-label="Permalink to &quot;3. 低代码工具 PaddleX 实践应用&quot;">​</a></h3><p>郜廷权（百度飞桨高级研发工程师 <a href="https://github.com/TingquanGao" target="_blank" rel="noreferrer">@TingquanGao</a>）作了以《低代码工具 PaddleX 实践应用》为主题的报告。报告重点讲解了百度飞桨低代码开发工具 PaddleX ，包括产品设计特点，功能使用等方面。并分享了大模型时代下深度学习落地应用面临的问题，以及 PaddleX 提出的解决方案：低代码开发方式与多模型串联方式。报告体现了百度飞桨在深度学习模型开源建设方面的贡献。 <img src="'+h+'" alt="百度飞桨高级研发工程师郜廷权"></p><h3 id="_4-从零开始的开源之旅" tabindex="-1">4. 从零开始的开源之旅 <a class="header-anchor" href="#_4-从零开始的开源之旅" aria-label="Permalink to &quot;4. 从零开始的开源之旅&quot;">​</a></h3><p>汪昕（美康生物算法工程师、PaddleOCR PMC Chair、飞桨开发者技术专家 PPDE <a href="https://github.com/GreatV" target="_blank" rel="noreferrer">@GreatV</a>）分享了自己的开源经历，从薅 GitHub 羊毛到成为开源贡献者，从 typo fix 到深入参与开源项目建设，从成为 PaddleOCR Contributor 到成为 Paddle Committer 的参与开源社区的经历。 <img src="'+d+'" alt="飞桨开发者技术专家汪昕"></p><h3 id="_5-开源让我越来越领先" tabindex="-1">5. 开源让我越来越领先 <a class="header-anchor" href="#_5-开源让我越来越领先" aria-label="Permalink to &quot;5. 开源让我越来越领先&quot;">​</a></h3><p>王海涛（百度飞桨研发工程师 <a href="https://github.com/yulangz" target="_blank" rel="noreferrer">@yulangz</a>）作了以《开源让我越来越领先》为主题的报告。重点介绍了自己在学生生涯中是如何接触到开源，如何参与开源，以及开源带给了自己哪些收获。以自己的切身经历，告诉同学们如何参与开源，为什么要参与开源，激发同学们对开源的兴趣与热情。 <img src="'+p+'" alt="百度飞桨研发工程师王海涛"></p><h3 id="_6-文心一言与文小言-生成式-ai-的案例解读" tabindex="-1">6. 文心一言与文小言：生成式 AI 的案例解读 <a class="header-anchor" href="#_6-文心一言与文小言-生成式-ai-的案例解读" aria-label="Permalink to &quot;6. 文心一言与文小言：生成式 AI 的案例解读&quot;">​</a></h3><p>张子彧（百度飞桨产品运营 <a href="https://github.com/shiyuasuka" target="_blank" rel="noreferrer">@shiyuasuka</a> ）作了《飞桨领航团开学季高校行 AI 科普》为主题的报告。报告讲解了 AI 这门学科的起源发展和目前的主流分类，分享了百度飞桨领航团在高校的布局以及同学们可以利用 AIstudio 开源平台做出怎样的项目。同时重点以文小言为例子为大家介绍提示词工程师的一些技巧并引导同学现场构建智能体。 <img src="'+u+'" alt="百度飞桨产品运营张子彧"></p><h3 id="写在最后-飞桨开源社区活动介绍" tabindex="-1">写在最后：飞桨开源社区活动介绍 <a class="header-anchor" href="#写在最后-飞桨开源社区活动介绍" aria-label="Permalink to &quot;写在最后：飞桨开源社区活动介绍&quot;">​</a></h3><p>骆涛（百度飞桨资深研发工程师 <a href="https://github.com/luotao1" target="_blank" rel="noreferrer">@luotao1</a>）介绍了飞桨开源社区的活动。我们会不定期走进校园、开展线下 Meetup，线上的启航计划、快乐开源以及进阶的飞桨黑客松。欢迎大家持续关注飞桨的各种活动哦，对于对此有兴趣、愿意贡献力量的开发者，也可以联系 <a href="https://github.com/sunzhongkai588" target="_blank" rel="noreferrer">孙师傅</a><img src="'+c+'" alt="百度飞桨资深研发工程师骆涛"></p>',18)])])}const I=e(_,[["render",m]]);export{x as __pageData,I as default};
